import React from "react";

type FiltersProps = {
  handleChangeComplete: (value: boolean) => void;
};

export default function Filters({ handleChangeComplete }: FiltersProps) {
  return (
    <div>
      <h1>Filters</h1>
      <div>
        <h2>Completed</h2>
        <label>
          <input
            type="checkbox"
            onChange={(event) =>
              handleChangeComplete(event.target.checked, "completed")
            }
          />
          <span>Completed</span>
        </label>
        <label>
          <input
            type="checkbox"
            onChange={(event) =>
              handleChangeComplete(event.target.checked, "not-completed")
            }
          />
          <span>Not Completed</span>
        </label>
      </div>
    </div>
  );
}
